import React from "react";
import { Nav, NavBarContainer, NavLogo } from "./NavBar.elements";

const NavBar = () => {
  return (
    <>
      <Nav>
        <NavBarContainer>
          <NavLogo to="/" as="img" src="images/logo.svg"></NavLogo>
        </NavBarContainer>
      </Nav>
    </>
  );
};

export default NavBar;
